delete from customers

declare @x int=1, @personalNO bigint=10050270901

while (@x<=500)
	begin

			declare 	
			
			@name 
			varchar(200)=(select [Name] from [base.name]
			where nameid=cast((rand()*1000)as int)%200+1),
			
			@surname 
			varchar(200)=lower((select surname from [base.surname]
			where surnameid= CAST((rand()*100000)as int)% cast ((select max(surnameid) from [base.surname])+1 as int))),
			@z 
			int=(select CAST((rand()*100000)as int)%30409+1 )
			
		

			

	City,
	[state],
	emailaddress,
	phone,
	birthdate)

	values(@name,@surname,@personalNO, 
	
			(select city from [base.city]
			where cityid=@Z),

			(select state_name from [base.city]
			where cityid=@z
			),
			CONCAT(@name,'.',@surname,@x,'@Gmail.com'),
			
			
			concat('(',(select AreaCode from [base.city]
			where  cityid=@z),') ',( cast(rand()*1000as int)%900+100),' ',( cast(rand()*1000 as int))%900+100) ,
			
			cast(DATEADD(DAY,-cast((rand()*100000000)as int)%22000-18*(365),getdate())as date)
			)
	
	
	select @x=@x+1,
	@personalNO=@personalNO+cast(rand()*100000000 as int)%80000000+1

end






