create table #table_curr
(curid int identity(1,1) ,currency char(3))

declare  @idd int=1


while (@idd <= 1500)
begin
declare
@cur 
char(3)=(select #table_curr.currency from #table_curr 
where curid=(select (cast(rand()*10 as int)%3+1))),

@actyid
int=( select (cast(rand()*10 as int)%5+1)),

@rand int=rand()*100




IsActive,
FilialID1,
CustomerID

)

values(@cur,
@actyid,
(

select case 
when @rand %2=0 then 1
when @rand %3=0 then 1
when @rand %7=0 then 1
when @rand %5=0 then 1
when @rand %11=0 then 1
else 0
end
)
, ((cast(rand()*100 as int)%(select max(filialid) from [dbo].[filials]))+1),
((cast(rand()*10000 as int)% (select max(PersonID) from customers))+1)

)
declare
@diffopendate

int=((cast(rand()*100000000as int)) % (
	  datediff( SECOND,
			 (select openingday from filials
			where filialid=(select FilialID1 from Accounts
			where AccountID=@idd)),getdate()))),

@startpoint 
datetime=  (select openingday from filials
			where filialid=(select FilialID1 from Accounts
			where AccountID=@idd))
update Accounts
	set OpenDate=(select (DATEADD(second,@diffopendate,@startpoint)))
	where AccountID=@idd

	




set @idd=@idd+1

end

